import { Component } from "react"
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faUser,faFile,faPencilAlt,faCamera,faAngleRight} from '@fortawesome/fontawesome-free-solid'
import { Link, useNavigate } from "react-router-dom";
import "../skills.css"
import imageOne from "./cv-example-auckland-333333.jpg"
import imageTwo from "./cv-example-edinburgh-505577.jpg"
import imagethree from "./cv-example-princeton-3b3936.jpg"

class Template extends Component{
  
    componentDidMount(){
       let temp =  document.getElementById("tempselect");
    temp.onclick=function(){
        temp.classList.add("temp-active")
    }
   
    }

  function () {
        document.getElementById("download")
            .addEventListener("click", () => {
                const invoice = this.document.getElementById("invoice");
             
                var opt = {
                    margin: 1,
                    filename: 'myfile.pdf',
                    image: { type: 'jpeg', quality: 0.98 },
                    html2canvas: { scale: 2 },
                    jsPDF: { unit: 'in', format: 'letter', orientation: 'portrait' }
                };
                html2pdf().from(invoice).set(opt).save();
            })
    }
    render(){
       
        return(
            <div>
            <div className="Page-style"></div>

<div className="Parent-Element">
<div className="container">
{/*header start */}
<header className="Header">
<h3>My Experiances</h3>
</header>
{/*header End */}


    {/*Progress Bar Start */}

<div className="Progress-Bar-section" >
<div className="row">
<div className="col-sm-12 Progress-bar-container" style={{justifyContent:"center",display:"flex",position:"relative"}}>
<div className="col-sm-6 Bar">
<div className="progres-lvl" style={{visibility:"hidden"}}><FontAwesomeIcon icon={faUser}  /></div>
<div className="progres-lvl b-2"><FontAwesomeIcon icon={faFile} /></div>
<div className="progres-lvl"><FontAwesomeIcon icon={faPencilAlt} /></div>

</div>
</div>
<div className="col-sm-12 Progress-bar-container" style={{justifyContent:"center",display:"flex",position:"relative"}}>
<div className="col-sm-1 Bars-f" style={{width:"49.055%"}}>
<div className="progres-lvl"><FontAwesomeIcon icon={faUser} /></div>
<div className="progres-lvl p-3"><FontAwesomeIcon icon={faFile} /></div>
<div className="progres-lvl"><FontAwesomeIcon icon={faPencilAlt} /></div>


</div>
</div>


<div className="col-sm-12">
<div className="col-sm-6 steps">
<div className="">Personal</div>
<div className="">Experiances</div>
<div className="" >Template</div>

</div>
</div>

</div>
</div>
{/*Progress Bar End */}


{/*Form */}
<div className="container" style={{marginTop:"3em"}}>
    <div className="row" style={{display:"flex",justifyContent:"space-evenly"}}>
    <div className="col-sm-3 temp" >
        <img src={imageOne} style={{width:"19rem",height:"27rem",margin:"8px -2px"}}/>
    </div>
    <div className="col-sm-3 temp"  id="tempselect">    
        <img src={imageTwo} style={{width:"19rem",height:"27rem",margin:"8px -2px"}}/>
</div>
    <div className="col-sm-3 temp" >
    <img src={imagethree} style={{width:"19rem",height:"27rem",margin:"8px -2px"}}/>

    </div>

    </div>
</div>

{/*End Form */}
<button id="download">Download Resume</button>


</div>
</div>
</div>
            )
    }
}
export default Template
